import { makeStyles } from '@mui/styles';

export default makeStyles(()=>({
    form:{
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        width: '500px',
        height: 'auto',
        padding: '20px',
        borderRadius: '5px',
       

     
    },
    input:{
        height: '40px',
        marginTop: '10px',
        marginBottom: '10px',
        border: '2px solid grey',
        borderRadius: '2px',
        fontSize: '20px',
        
    },
    

}))
